import Post from '../components/post'

function IndexPage() {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
     fetch('http://localhost:2000/post').then(response => {
      response.json().then(posts => {
         setPosts(posts);
      })
    })
  }, [])
  return (
   <>
   <Post />
   <Post />

   </>
  )
}

export default IndexPage
